import './App.css';
import CarMakesList from './CarMakesList'

const baseURL = `http://localhost:8080/api/makes`
class App extends Component {

  componentDidMount() {
    this.getCars()
  }


  getCars = () => {
    fetch(baseURL)
    .then(res => res.json())
    .then(data => console.log(data))
  }

  render() {
    return (
      <div>
        <CarMakesList />
      </div>
    );
  }

}

